(function (w, $) {

    var shareUrlPattern = 'http://share.yandex.ru/go.xml?service={service}&url={link}&title={title}&description={description}&image={image}';
    var shareOptsKeys = {
        service: true,
        link: true,
        title: true,
        description: true,
        image: true
    };

    function share(options) {
        var url = shareUrlPattern;

        for (var k in shareOptsKeys) {
            url = url.replace('{' + k + '}', encodeURIComponent(options[k]));
        }

        //console.log(url);

        window.open(url, '', 'left=20,top=20,width=500,height=500,toolbar=0,resizable=1');
    }

    function initialize(customOptions) {
        var options = {
            sharingItemSelector: '.js-share',
            sharingContainerSelector: '.js-sharing-container'
        };
        $.extend(options, customOptions || {});

        $('body').delegate(options.sharingItemSelector, 'click', function (event) {
            event.preventDefault();

            var $el = $(event.currentTarget);
            var $containerEl = $el.parents(options.sharingContainerSelector);

            var shareOpts = {}, k;
            shareOpts.link = document.location.href;
            shareOpts.title = $('title').text();

            for (k in shareOptsKeys) {
                if ($containerEl.data('share-' + k)) {
                    shareOpts[k] = $containerEl.data('share-' + k);
                }
            }

            for (k in shareOptsKeys) {
                if ($el.data('share-' + k)) {
                    shareOpts[k] = $el.data('share-' + k);
                }
            }

            share(shareOpts);
        });
    }

    w.Brouzie = w.Brouzie || {};
    Brouzie.Sharing = {
        initialize: initialize,
        share: share
    };
})(window, jQuery);


$(function () {
    jQuery('.js-simplebox').simplebox();
    clearInputs();

    Brouzie.Sharing.initialize();

    switch (queryString['continue']) {
        case 'vote':
            var $voteEl = $('#vote-ajax-link');
            if (!$voteEl.length) {
                return;
            }
            //FIXME: this doesn't work because session id changes. https://github.com/symfony/symfony/issues/3919
            if (queryString.csrf == $voteEl.data('csrf')) {
                $voteEl.click();
            } else {
                $(window).scrollTop($voteEl.offset().top - 20);
            }
            break;

        case 'registration':
            $('[href="#popup-girl-registration"]:first').click();
            break;

        case 'comment':
            $(window).scrollTop($('#girl-comment-form').offset().top);
            $('#girl-comment-form textarea').focus();
            break;
    }

    $('#content .js-gallery-photo').gallery({
        duration: 700,
        autoRotation: 4000,
        listOfSlides: 'ul.gallery-holder > li',
        autoHeight: true,
        switcher: '.switcher > li'
    });
    $('.scrollable').scrollbar({
        type: 'simple',
        scrollx: false
    });
    $('input, select').not('input:file ').not('select[class]').styler();
    $('#content .box-line .gallery').gallery({
        autoRotation: false,
        flexible: true,
        listOfSlides: '.gallery-holder > ul > li'
    });
    if (typeof $.fn.fancybox == 'function') {
        $('a.fancybox').fancybox({
            overlayOpacity: 0.5,
            showCloseButton: false,
            overlayColor: '#000',
            padding: 0,
            titlePosition: 'over',
            titleFormat: function (title, currentArray, currentIndex, currentOpts) {
                var temp = currentArray.eq(currentIndex).parents('div.participant').find('.hold-bottom').clone();
                temp.append('<div class="wrap-number"><span>' + (currentIndex + 1) + ' из ' + currentArray.length + '</span></div>');

                return temp;
            }
        });
    }
    if (typeof $.fn.selectmenu == 'function') {
        $('select.selectmenu').selectmenu({
            style: 'popup',
            maxHeight: 200
        });
    }
});

function clearInputs() {
    $('input:text, input:password, textarea, input[type="url"], input[type="email"]').not('.excepted').each(function () {
        var _el = $(this);
        var _val = _el.val();
        _el.attr('alt', _val);
        _el.bind('focus',function () {
            if (this.value == _val) {
                this.value = '';
                $(this).parent().addClass('ready');
            }
            $(this).parent().addClass('input-focus');
        }).bind('blur', function () {
                if (this.value == '') {
                    this.value = _val;
                    $(this).parent().removeClass('ready');
                }
                $(this).parent().removeClass('input-focus');
            });
    });
}

function initializeCitiesAutocomplete() {
    var autocomplete =
        $('#girl_cityTitle')
            .autocomplete({
                search: function (event, ui) {
                    //TODO: reset hidden city?
                    if (autocomplete.xhr) {
                        autocomplete.xhr.abort();
                    }
                },
                source: function (request, response) {
                    autocomplete.xhr = $.get(initializeCitiesAutocomplete.citiesSuggestUrl, { q: request.term }, function (data) {
                        response(data);
                    });
                },
                minLength: 2,
                select: function (event, ui) {
                    $('#girl_city').val(ui.item.id);
                }
            })
            .data('uiAutocomplete');

    autocomplete._renderItem = function (ul, item) {
        item.value = item.title;

        return $('<li>')
            .data('city-id', item.id)
            .append($('<a>').text(item.title))
            .appendTo(ul);
    };
}


var pageInit = {
    init: function(){
        this.goTo();
        this.menuScrol();
    },
    menuScrol: function(){
        var _mainNavFrame = $("#nav");
        var _body = $("body"), time;
            
        setTimeout(function(){
            var _this = $(this);
            _mainNavFrame.sly({
                horizontal: 1,
                itemNav: 'basic',
                smart: 1,
                activeClass: 'act',
                activateOn: 'click',
                mouseDragging: 1,
                touchDragging: 1,
                releaseSwing: 1,
                scrollBy: 1,
                speed: 300,
                elasticBounds: 1
            }, 200);
            _mainNavFrame.each(function() {
                _this.sly("toStart", _body.data("start_position"));
            });
        });
        
        $(window).resize(function(){
            if(time) clearTimeout(time);
            time = setTimeout(function(){
                _mainNavFrame.sly("reload");
            }, 200);
        })
    },
    goTo: function(){
        $('body').each(function(){
            var hold = $(this);
            var to;
            var header = hold.find('#header');
            var position, windH;
            
            var linkGoTo = hold.find('.go-to');
            var linkTop = hold.find('.go-to-top');
            
            linkGoTo.click(function(){
                $('html, body').animate({scrollTop: $(this).attr('href').offset().top - header.outerHeight()}, {queue:false, duration: 1300});
                
                return false;
            });
            
            linkTop.click(function(){
                $('html, body').animate({scrollTop: 0}, {queue:false, duration: 1300});
                
                return false;
            });
            
            
            function all(){
                position = $(window).scrollTop();
                windH = $(window).height();
                
                if(position > windH/2){
                    if(!linkTop.hasClass('visible')){
                        linkTop.addClass('visible');
                    }
                }
                else {
                    if(linkTop.hasClass('visible')){
                        linkTop.removeClass('visible');
                    }
                }
            }
            all();
            
            $(window).resize(function(){
                all();
            })
            
            $(window).scroll(function(){
                all();
            })
        });
    }
}

//new js
jQuery(document).ready(function(){
    pageInit.init();
});

